pragma solidity ^0.4.18;

import './browser/StandardToken.sol';

/*
* The Beep Token contract issues 8,500,000,000 Beep tokens to a specified reserve wallet address
*
*/

contract BeepToken is StandardToken {
    string public constant name = "Beep Token";
    string public constant symbol = "Beep";
    uint8 public constant decimals = 0;
    uint256 public constant totalSupply = 8500000000;

    function BeepToken(address reserve) public {
        balances[reserve] = totalSupply;
    }
}
